  position: relative;
  z-index: 10;
  height: calc(100vh - 100px);
  padding: 10px 20px;
  padding-bottom: 100px;
  font-size: 28px;
  background-color: #ebf1f6;
  border-radius: 14px 14px 0 0;
  border: solid 1px rgba(241, 209, 136, 0.8);
  .title {
    border-bottom: #d6dce8 1px solid;
    padding: 15px 0;
    color: #494b4f;
    margin-bottom: 20px;
    .right {
      :deep(.van-count-down) {
        display: inline-block;
      }
    }
  }
  .card_content {
  }
  .CR_item {
    color: #787f8c;
    background-color: #ffffff;
    border-radius: 14px;
    padding: 20px;
    p {
      padding: 8px 0;
      display: block;
      .cR_listImg {
        display: block;
        float: right;
        width: 53px;
        height: 76px;
      }
    }
    .van-button {
      float: right;
      color: #f9db95;
      display: block;
      width: 218px;
      height: 69px;
      background: url('../../../assets/images/activity/btn-task-2.png');
      background-size: cover;
      border: unset;
    }
  }
}

